import React from "react";
import style from "./global.module.css";

function Title(props) {
  const labelStyle = {
    color: "white",
    fontWeight: "bold",
    fontSize: "1.8em",
    marginLeft: "4px"
  };

  return (
    <div
      style={{
        position: "relative",
        display: "flex",
        alignItems: "center",
        gridColumnStart: "2"
      }}
    >
      <div
        style={{
          width: "4px",
          height: "28px",
          backgroundColor: "#c7493a"
        }}
      ></div>
      <label className="component-label" style={labelStyle}>
        {props.titleName}
      </label>
      {props.more === true && (
        <span
          className={style["view-all"]}
          style={{
            position: "absolute",
            right: "0px",
            bottom: "0px",
            fontSize: "1.2em",
            color: "#c7493a"
          }}
        >
          View All
        </span>
      )}
    </div>
  );
}

export default Title;
